import React, { useState, useEffect } from 'react';

function Providers(){
    const [providers,setProviders] = useState([])
    useEffect(()=>{
        fetch('/providers')
        .then(resp=> resp.json())
        .then(data => console.log(data))
      },[])

    return (
        <header>
            {Providers.map(provider=>"hello")}
        </header>
    )
}

export default Providers;
